from typing import List, Dict

def get_value(param: str, r: Dict[str, int]) -> int:
    if param.isdigit() and (param[0] == '-' and param[1:].isdigit()):
        return int(param)
    else:
        return r[param]

def execute_instructions(insts: List[List[str]]) -> Dict[str, int]:
    r = {chr(i): 0 for i in range(97, 123)}
    p = 0
    while p < len(insts):
        inst = insts[p][0]
        if inst == 'cpy':
            r[insts[p][2]] = get_value(insts[p][1], r)
        elif inst == 'dec':
            r[insts[p][1]] -= 1
        elif inst == 'inc':
            r[insts[p][1]] += 1
        elif inst == 'mul':
            r[insts[p][3]] += get_value(insts[p][1], r) * get_value(insts[p][2], r)
        elif inst == 'jnz':
            if get_value(insts[p][1], r) != 0:
                p += get_value(insts[p][2], r) - 1
        p += 1
    return r

